INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アヤネ", 0.0, "2030/12/17 14:59:59", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 102301, 2, 24001, 10046, 0.0, 0.0, 2, 401, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アヤネ", 0.0, "2030/12/17 14:59:59", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 102301, 1, 24002, 10046, 0.0, 2.21, 2, 402, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アヤネ", 0.0, "2030/12/17 14:59:59", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 102301, 2, 24003, 10046, 0.0, 0.0, 2, 403, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アサヒ", 0.0, "2030/12/17 14:59:59", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 192201, 2, 24004, 10046, 0.0, 1.99, 1, 701, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アサヒ", 0.0, "2030/12/17 14:59:59", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 192201, 1, 24005, 10046, 0.0, 2.21, 2, 702, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アサヒ", 0.0, "2030/12/17 14:59:59", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 192201, 2, 24006, 10046, 0.0, 3.33, 1, 703, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "部員３", 0.0, "2030/12/17 14:59:59", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 192301, 2, 24007, 10046, 0.0, 0.0, 2, 801, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "部員３", 0.0, "2030/12/17 14:59:59", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 192301, 1, 24008, 10046, 0.0, 2.68, 2, 802, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "部員３", 0.0, "2030/12/17 14:59:59", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 192301, 2, 24009, 10046, 0.0, 0.0, 2, 803, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "", 0.0, "2030/12/17 14:59:59", "やった！", 192501, 1, 24010, 10046, 0.0, 0.0, 1, 501, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "", 0.0, "2030/12/17 14:59:59", "勝ったよ！", 192501, 1, 24011, 10046, 0.0, 0.0, 1, 502, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "", 0.0, "2030/12/17 14:59:59", "いい調子！", 192501, 1, 24012, 10046, 0.0, 0.0, 1, 503, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", 0.0, "2030/12/17 14:59:59", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 113501, 6, 24013, 10046, 0.0, 5.33, 2, 111, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", 0.0, "2030/12/17 14:59:59", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 113501, 1, 24014, 10046, 0.0, 6.85, 2, 112, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", 0.0, "2030/12/17 14:59:59", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113501, 1, 24015, 10046, 0.0, 3.0, 2, 113, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ダイチ", 0.0, "2030/12/17 14:59:59", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 192401, 1, 24016, 10046, 0.0, 6.11, 2, 611, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ダイチ", 0.0, "2030/12/17 14:59:59", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 192401, 1, 24017, 10046, 0.0, 6.75, 2, 612, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ダイチ", 0.0, "2030/12/17 14:59:59", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 192401, 2, 24018, 10046, 0.0, 0.0, 2, 613, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ハツネ", 0.0, "2030/12/17 14:59:59", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 113401, 2, 24019, 10046, 0.0, 4.52, 1, 211, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ハツネ", 0.0, "2030/12/17 14:59:59", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 113401, 2, 24020, 10046, 0.0, 3.89, 1, 212, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ハツネ", 0.0, "2030/12/17 14:59:59", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 113401, 1, 24021, 10046, 0.0, 13.49, 2, 213, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "カヤ", 0.0, "2030/12/17 14:59:59", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 106501, 1, 24022, 10046, 0.0, 3.17, 2, 311, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "カヤ", 0.0, "2030/12/17 14:59:59", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 106501, 1, 24023, 10046, 0.0, 4.42, 2, 312, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "カヤ", 0.0, "2030/12/17 14:59:59", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 106501, 6, 24024, 10046, 0.0, 2.89, 1, 313, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アヤネ", 0.0, "2030/12/17 14:59:59", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 102301, 4, 24025, 10046, 0.0, 3.71, 3, 421, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "アサヒ", 0.0, "2030/12/17 14:59:59", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 192201, 2, 24026, 10046, 0.0, 5.1, 1, 721, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "部員３", 0.0, "2030/12/17 14:59:59", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 192301, 1, 24027, 10046, 0.0, 4.34, 3, 821, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "", 0.0, "2030/12/17 14:59:59", "いい勝負だったよ\nまたやろうね", 192501, 1, 24028, 10046, 0.0, 0.0, 1, 521, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", -360.0, "2030/12/17 14:59:59", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 113501, 1, 24029, 10046, 0.0, 5.62, 2, 101, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", -360.0, "2030/12/17 14:59:59", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 113501, 1, 24030, 10046, 0.0, 9.58, 2, 102, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", -360.0, "2030/12/17 14:59:59", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 113501, 2, 24031, 10046, 0.0, 0.0, 2, 103, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", -360.0, "2030/12/17 14:59:59", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 113501, 2, 24032, 10046, 0.0, 9.13, 1, 104, 24);
INSERT INTO `v1_d1ac2f9ea2a02687bf98a0d1abe3a35bcd3ea42e521af1a0f3bc1bc9637bca50` VALUES ("2020/07/31 12:00:00", "ミサト", -360.0, "2030/12/17 14:59:59", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 113501, 1, 24033, 10046, 0.0, 8.27, 2, 105, 24);
